import axios from 'axios';


class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            values: [],
            query: ""
        }
    }

    onchange = e => {
        const query = e.target.value;
        this.setState({ query: query });
        console.log(this.state.query)
    };


    render() {
        const { query } = this
        return (
            <div>
                <h1>Home Component</h1>
                <input name="query" onChange={this.onchange}  type="text" />

            </div>
        );
    }
}

export default Home;
